		public static bool operator >(long value, RTLBitArray op)
			=> new RTLBitArray(value) > op;
		public static bool operator >=(RTLBitArray op, long value)
			=> op >= new RTLBitArray(value);
		public static bool operator >=(long value, RTLBitArray op)
			=> new RTLBitArray(value) >= op;
		#endregion operators for long
	}
}
